import Foundation

protocol ImageURL {
    
    var locationURLString : String { get set}
    var locationURL : URL { get}
    
}

struct Team5 : Identifiable {
    let id: UUID = UUID()
    var name: String
    var members : [Member] // 얘를 가지고 포문을 돌려야함
}

struct Member : Identifiable, ImageURL {
    let id: UUID = UUID()
    let name : String
    let mbti : String
    let mbtiDescription : String
    var locationURLString : String
    var locationURL: URL {
        get {
            return URL(string: locationURLString)!
        }
    }
    let like : String
    let hate : String
    
    var pet : String
  init(name: String, mbti: String, mbtiDescription: String, locationURLString: String, like: String, hate: String, pet: String) {
    self.name = name
    self.mbti = mbti
    self.mbtiDescription = mbtiDescription
    self.locationURLString = locationURLString
    self.like = like
    self.hate = hate
    self.pet = pet
  }
}

